CREATE DEFINER=`root`@`localhost` PROCEDURE `MostrarCajaMesFechaxFecha` (IN `Contrato` BIGINT, IN `fechain` DATE, IN `fechafin` DATE)  NO SQL
select c.fechaApertura,sum(i.efectivo),Sum(t.monto),sum(e.montoEgresoCaja),sum(ct.montoECT),c.saldoCaja
from caja c inner join ingresocaja i on c.idCaja=i.idCaja
inner join ingresotarjeta t on t.idCaja=c.idCaja
inner join egresocaja e on e.idCaja=c.idCaja
inner join egresochequetrans ct on ct.idCaja=c.idCaja
where c.estado=0 and c.idContratoPersonal=Contrato and c.fechaApertura between fechain and fechafin
group by c.fechaApertura,i.efectivo,t.monto,e.montoEgresoCaja,ct.montoECT,c.saldoCaja$$

