SELECT c.idContacto,p.idPersonal,c.nombre,c.apellido,TIMESTAMPDIFF(YEAR,c.edad,CURDATE()),c.ci,c.telefono,c.correo,c.imagen,cp.fechaContrato,cp.fechaFinContrato,cp.observacion,cpe.nombreCargoPersonal,s.nombreSucursal,cp.idContratoPersonal
FROM `contacto`c,`personal` p,`contratopersonal` cp,`caja` ca,`cargopersonal` cpe,`sucursal` s  
WHERE ca.idContratoPersonal=cp.idContratoPersonal AND cp.idPersonal=p.idPersonal AND p.idContacto=c.idContacto AND ca.fechaApertura=fecha AND cp.idCargoPersonal=cpe.idCargoPersonal AND cp.idSucursal=s.idSucursal$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `usuarioSucursal` (IN `idSucursal` BIGINT(20))  NO SQL
SELECT c.idContratoPersonal
FROM sucursal s,contratopersonal c
Where c.idSucursal=s.idSucursal AND s.idSucursal=idSucursal AND c.observacion="ventas"$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Vencimiento` ()  NO SQL
select  count(v.idContratoMembresia)
from cliente l inner join contacto c on l.idContacto=c.idContacto
inner join contratomembresia v on v.IdCliente=l.IdCliente 
inner join paquete p on p.idPaquete= v.idPaquete
inner join categoriapaquete cp on cp.idCategoriaPaquete=p.idCategoriaPaquete
where Month(v.FechaFin)=Month(curdate()) and Year(v.FechaFin)=Year(curdate())
order by v.idContratoMembresia$$

DELIMITER ;

